
{% load static %}
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <meta http-equiv="X-UA-Compatible" content="ie=edge">
  <title>{{ title }}</title>

  <script src="//use.typekit.net/xyl8bgh.js"></script>
  <script>try{Typekit.load();}catch(e){}</script>
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/meyer-reset/2.0/reset.min.css">
  
    <link rel='stylesheet prefetch' href='http://maxcdn.bootstrapcdn.com/font-awesome/4.2.0/css/font-awesome.min.css'>
  <link rel='stylesheet prefetch' href="{% static 'step/css/__codepen_io_andytran_pen.css' %}">
  
        <link rel="stylesheet" href="{% static 'step/css/style.css' %}">


	<link rel="icon" href="{% static 'step/second/img/Fevicon.png' %}" type="image/png">

  <link rel="stylesheet" href="{% static 'step/second/vendors/bootstrap/bootstrap.min.css' %}">
  <link rel="stylesheet" href="{% static 'step/second/vendors/fontawesome/css/all.min.css' %}">
  <link rel="stylesheet" href="{% static 'step/second/vendors/themify-icons/themify-icons.css' %}">
  <link rel="stylesheet" href="{% static 'step/second/vendors/linericon/style.css' %}">
  <link rel="stylesheet" href="{% static 'step/second/vendors/owl-carousel/owl.theme.default.min.css' %}">
  <link rel="stylesheet" href="{% static 'step/second/vendors/owl-carousel/owl.carousel.min.css' %}">

  <link rel="stylesheet" href="{% static 'step/second/css/style.css' %}">
</head>
<body>
  <!--================Header Menu Area =================-->
  <header class="header_area">
    <div class="main_menu">
      <nav class="navbar navbar-expand-lg navbar-light">
        <div class="container box_1620">
          <!-- Brand and toggle get grouped for better mobile display -->
         
          <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span class="icon-bar"></span>
            <span class="icon-bar"></span>
            <span class="icon-bar"></span>
          </button>
          <!-- Collect the nav links, forms, and other content for toggling -->
          <div class="collapse navbar-collapse offset" id="navbarSupportedContent">
            <ul class="nav navbar-nav menu_nav justify-content-center">
              <li class="nav-item active"><a class="nav-link" href="/fossee4">go back to Home</a></li> 
          
            </ul>
          </div> 
        </div>
      </nav>
    </div>
  </header>
  <!--================Header Menu Area =================-->
  <div style="text-align:center">{{message}}</div>
  <section class="blog-post-area section-margin mt-4">
    <div class="container">
     {% for obj in images %}
            <div class="column">
    
                    <div class="post-module">
                      <div class="thumbnail">
                        <img src="{% get_media_prefix %}{{ obj.image }}"/>
                      </div>
                            <div class="post-content">
                            <h1 class="title"> created by:{{ obj.createdby }}</h1>
                            <p class="description">uniqueId:{{ obj.uniqueId }}</p>
                            </div>
                    </div>
                  </div>{% endfor %}
                  
                  
                </div></section>
  
    <!--================ Blog slider end =================-->  

 

  <script src="{% static 'step/second/vendors/jquery/jquery-3.2.1.min.js' %}"></script>
  <script src="{% static 'step/second/vendors/bootstrap/bootstrap.bundle.min.js' %}"></script>
  <script src="{% static 'step/second/vendors/owl-carousel/owl.carousel.min.js' %}"></script>
  <script src="{% static 'step/second/js/jquery.ajaxchimp.min.js' %}"></script>
  <script src="{% static 'step/second/js/mail-script.js' %}"></script>
  <script src="{% static 'step/second/js/main.js' %}"></script>

  <script src='http://cdnjs.cloudflare.com/ajax/libs/jquery/2.1.3/jquery.min.js'></script>

    <script src="{% static 'step/js/index.js' %}"></script>
</body>
</html>
